import React from "react";
import Card from "../UI/Card";
import User from "./User";
const UserList = (props) => {
  return (
    <Card>
      {props.userList.map((user) => (
        <User name={user.name} age={user.age} />
      ))}
    </Card>
  );
};

export default UserList;
